function generateVmessLink(vmessData) {
  // 将vmessData对象转换为JSON字符串
  const jsonString = JSON.stringify(vmessData);

  // 使用encodeURIComponent转换Unicode字符，然后用unescape转换为Latin1范围的字符
  const uriEncodedString = encodeURIComponent(jsonString);
  const latin1String = unescape(uriEncodedString);

  // 现在使用btoa对经过处理的字符串进行Base64编码
  const base64String = btoa(latin1String);

  // 将Base64编码的字符串添加到vmess://前缀后，形成完整的Vmess链接
  return `vmess://${base64String}`;
}



